let name = useSelector(state => state.user?.userName)
console.log(name,"name")
let dispatch = useDispatch()
    let logout = ()=>{
        firebase.auth().signOut()
        .then(() => {

            dispatch({
                type: "logout",
                payload: ""
            })
        })
        .catch((error) => {
            var errorCode = error.code;
            var errorMessage = error.message;
            alert(errorMessage)
        });

    }
    return<>

<div className="navbar">
