    <div className="searchbar">
    Search <input type="search" />
    </div>
    <div className="button">
        <Link to="/products-detailed"><button>+sell</button></Link>
        <button onClick={logout}>Logout</button>
    </div>
    <div>
        {name}
    </div>
</div>
